To create a React and Node.js/Express.js web app for creating or adding dummy data, showing it, and deploying it on Heroku or any other free platform, you can follow these steps:

1. Set up the project:
   - Create a new directory for your project.
   - Open a terminal and navigate to the project directory.
   - Run `npm init` to initialize a new Node.js project and follow the prompts.

2. Set up the backend (Node.js and Express.js):
   - Create a new directory named `server` inside the project directory.
   - Navigate to the `server` directory in the terminal.
   - Run `npm init` to initialize a new Node.js project for the server and follow the prompts.
   - Install the necessary dependencies by running:
     ```
     npm install express cors
     ```
   - Create a new file named `server.js` inside the `server` directory.
   - Open `server.js` and add the following code:
     ```javascript
     const express = require('express');
     const cors = require('cors');

     const app = express();
     app.use(cors());
     app.use(express.json());

     // Dummy data
     let data = [];

     // API endpoints
     app.get('/api/data', (req, res) => {
       res.json(data);
     });

     app.post('/api/data', (req, res) => {
       const newItem = req.body;
       data.push(newItem);
       res.status(201).json(newItem);
     });

     // Start the server
     const port = process.env.PORT || 5000;
     app.listen(port, () => {
       console.log(`Server is running on port ${port}`);
     });
     ```

